import{_ as e}from"./chunks/youtube-embed.ab0856e3.js";import{_ as t,o,c as r,e as l,b as i}from"./chunks/framework.dd5ab16e.js";const k=JSON.parse('{"title":"Дар труда","description":"Производственный коворкинг","frontmatter":{"title":"Дар труда","description":"Производственный коворкинг","date":"2014-11-13","icon":"logo.png","cover":"cover.jpg","city":"г.  Москва","address":"ул. Электрозаводская, 21 к.3,3й этаж, пом.305","place":"м.Электрозаводская","email":"master@dartruda.ru","url":"http://www.dartruda.ru","tel":"+7(495)120-04-96","youtube":"https://www.youtube.com/watch?v=CLKMDklbANw","hours":"вт - сб, с 11:00 до 21:00, вс, с 14:00 до 21:00 (пн - выходной)","coord":[55.787839595922236,37.704075812351626],"vk":"dartruda","instagram":"dartruda","youtube-channel":"UCXTVEgLF1pFeVyLrcb4htug","status":"open"},"headers":[],"relativePath":"workshop/catalog/dar-truda/index.md","filePath":"workshop/catalog/dar-truda/index.md"}'),n={name:"workshop/catalog/dar-truda/index.md"},d=i('<blockquote><p><strong>Общественная мастерская «Дар Труда» — площадка для реализации идей своими руками и передачи опыта и знаний на базе столярного цеха.</strong></p></blockquote><blockquote><p>Наша общественная мастерская «Двор Сотрудней», открывшаяся в 2012 году, стала одной из первых в стране. Теперь мы строим один из первых производственных коворкингов. Работая с нами, вы принимаете участие в увлекательном эксперименте и получаете опыт построения деловых и общественных отношений нового типа! Константин Скворцов, Основатель</p></blockquote><blockquote><p>Мы развиваем такие направления, как совместные закупки материалов и инструмента, предоставление заказов через мастерскую, единое продвижение продукции и услуг всех мастеров коворкинга. Не забудьте — у нас есть полный спектр оборудования и всё необходимое для создания разнообразных столярных изделий Олег Фараджуллаев, Основатель</p></blockquote><h3 id="столярныи-коворкинг" tabindex="-1">Столярный коворкинг <a class="header-anchor" href="#столярныи-коворкинг" aria-label="Permalink to &quot;Столярный коворкинг&quot;">​</a></h3><p>Основа организации «Дар Труда», предоставляющая аренду рабочих мест в оборудованной столярной мастерской для начинающих и опытных мастеров.</p><h3 id="учебныи-центр" tabindex="-1">Учебный центр <a class="header-anchor" href="#учебныи-центр" aria-label="Permalink to &quot;Учебный центр&quot;">​</a></h3><p>Отдел, помогающий освоить новичкам необходимые знания и навыки при помощи обучающих программ. Каждое воскресенье мастерская превращается в единый учебный центр, где проводятся по несколько образовательных событий одновременно.</p><p>Виды обучающих программ: - Основы работы на станках; - Разовые занятия; - Разовые donation-занятия; - Занятия для детей; - Курсы (циклы занятий);</p><h3 id="отдел-заказов" tabindex="-1">Отдел заказов <a class="header-anchor" href="#отдел-заказов" aria-label="Permalink to &quot;Отдел заказов&quot;">​</a></h3><p>Отдел, принимающий и исполняющий заказы различной направленности. Выделены отдельные направления: - Столярные заказы; - Лазерная резка и гравировка на станках с ЧПУ; - Раскрой и 3d фрезеровка на станках с ЧПУ; - УФ-печать на пленке и листовых материалах; - 3d-печать полимером на PRINTBOX3D ;</p><h3 id="почему-стоит-заглянуть-к-нам" tabindex="-1">Почему стоит заглянуть к нам? <a class="header-anchor" href="#почему-стоит-заглянуть-к-нам" aria-label="Permalink to &quot;Почему стоит заглянуть к нам?&quot;">​</a></h3><p>Мы функционируем на базе общественной мастерской - это позволяет нам предлагать выгодные комплексные услуги для Вас</p><h4 id="удобное-расположение" tabindex="-1">Удобное расположение <a class="header-anchor" href="#удобное-расположение" aria-label="Permalink to &quot;Удобное расположение&quot;">​</a></h4><p>Мы расположены на ст. м. Преображенская площадь - удобно добраться и на метро, и на автомобиле.</p><h4 id="выгодная-стоимость" tabindex="-1">Выгодная стоимость <a class="header-anchor" href="#выгодная-стоимость" aria-label="Permalink to &quot;Выгодная стоимость&quot;">​</a></h4><p>Цены на многие наши услуги ниже среднерыночных по Москве</p><h4 id="многообразие-оборудования" tabindex="-1">Многообразие оборудования <a class="header-anchor" href="#многообразие-оборудования" aria-label="Permalink to &quot;Многообразие оборудования&quot;">​</a></h4><p>Фрезерные станки с ЧПУ, лазерные станки с ЧПУ, 3D-принтер, UV-принтер , а также все для деревообработки.</p><h4 id="долгосрочное-сотрудничество" tabindex="-1">Долгосрочное сотрудничество <a class="header-anchor" href="#долгосрочное-сотрудничество" aria-label="Permalink to &quot;Долгосрочное сотрудничество&quot;">​</a></h4><p>Многие наши клиенты остаются с нами надолго благодаря широкому спектру предлагаемых услуг.</p><h4 id="наш-адрес" tabindex="-1"><strong>Наш адрес</strong> <a class="header-anchor" href="#наш-адрес" aria-label="Permalink to &quot;**Наш адрес**&quot;">​</a></h4><p>Метро Преображенская площадь, 1-я улица Бухвостова, 12/11 (бывшая территория НИИДАР – институт дальней радиосвязи), корпус №16, 1 этаж.</p><p><em>Добраться пешком:</em></p><p>Станция метро Преображенская площадь, последний вагон из центра (выход в сторону кинотеатра им. Моссовета), при выходе из стеклянных дверей – направо, затем налево по лестнице, далее 50 метров в сторону строящейся церкви до главной проходной НИИДАР, корпус №12. Оттуда звоните нам – мы закажем пропуск и вас впустят на территорию.</p><p><em>На автомобиле:</em></p><p>Лучше всего припарковаться на 1-ой улице Бухвостова и пройти к главной проходной, расположенной возле метро, в 12-м корпусе. Въезд на территорию (платный, 150 р на 3 часа) – с 1-ой улицы Бухвостова, 12/11, за корпусом №16. Подъезжая, звоните нам – мы подойдём к воротам и поможем проехать через пост охраны.</p><h4 id="наши-цели" tabindex="-1"><strong>Наши цели</strong> <a class="header-anchor" href="#наши-цели" aria-label="Permalink to &quot;**Наши цели**&quot;">​</a></h4><ul><li>Создать единое пространство для эффективной деятельности по различным ремесленным направлениям.</li><li>Дать возможность разным людям работать своими руками, получая доход.</li><li>Помочь тем, кто желает стать соучастником созидательного процесса.</li><li>Принять участие в формировании культуры современного ручного труда и зарождающихся форм нового общественного взаимодействия.</li><li>Привлечь внимание общественности и государства к важности такого аспекта в развитии страны, как ремесленничество.</li><li>Повысить уровень качества ремесленных изделий за счёт интеграции традиций с современными технологиями.</li></ul><h4 id="наши-услуги" tabindex="-1"><strong>Наши услуги</strong> <a class="header-anchor" href="#наши-услуги" aria-label="Permalink to &quot;**Наши услуги**&quot;">​</a></h4><ul><li>Аренда мастерских на постоянной и повременной основе.</li><li>Обеспечение доступа к оборудованию с необходимыми профессиональными консультациями.</li><li>Организация предметного обучения работе с материалами для учащихся и всех желающих.</li><li>Предоставление информационной и маркетинговой поддержки мастерам, занимающимся штучным и мелкосерийным производством или разработкой прототипов.</li><li>Передача опыта, традиций и технологий.</li><li>Организация межотраслевого синергетического взаимодействия.</li></ul><p>Особо важный фактор деятельности «Дара Труда» – <strong>синергетический эффект</strong>, который проявляется в нескольких аспектах:</p><ul><li>Позитивное взаимодействие – уход от идеи жёсткой рыночной конкуренции к конструктивному сотрудничеству.</li><li>Общие гости – посетители коворкинга имеют возможность обратиться за помощью к разным мастерам, расширяя партнёрские взаимосвязи.</li><li>Единая структура продаж – все мастера пользуются услугами отдела маркетинга (продвижения и распространения), тем самым существенно экономя свои ресурсы.</li><li>Максимальная локализация производства – один проект могут вести несколько мастеров разных профилей, минимизируя заказы на стороне.</li><li>Благотворительная программа – вовлечение малообеспеченных и социально неустроенных групп граждан в общественно-полезную деятельность.</li><li>Подготовка кадров – курсанты наших учебных программ в перспективе становятся партнёрами мастеров и участниками проектов коворкинга.</li></ul><p>Становясь нашим соучастником, мастер любого профессионального уровня получает доступ к набору услуг, необходимых для ведения созидательной деятельности, максимально эффективной в современных условиях.</p><h4 id="наше-портфолио" tabindex="-1"><strong>Наше портфолио</strong> <a class="header-anchor" href="#наше-портфолио" aria-label="Permalink to &quot;**Наше портфолио**&quot;">​</a></h4><p>Реализованные проекты производственного коворкинга «Дар Труда» собраны в объединённом портфолио наших мастеров – на <a href="http://trudodvor.ru/portfolio" class="external-link" target="_blank" rel="noreferrer">trudodvor.ru/portfolio</a>.</p>',35);function h(s,p,u,c,b,m){const a=e;return o(),r("div",null,[d,l(a,{link:"https://youtu.be/6AMOfoFdlNQ"})])}const f=t(n,[["render",h]]);export{k as __pageData,f as default};
